// src/components/About.jsx
import { Container, Typography, Grid, Box } from "@mui/material";
import { motion } from "framer-motion";

const sections = [
  {
    title: "Who We Are",
    desc: "PhysioTattva is a leading physiotherapy and rehabilitation center providing evidence-based treatments with advanced technology to restore movement and improve quality of life.",
    img: "https://images.unsplash.com/photo-1550831107-1553da8c8464?auto=format&fit=crop&w=900&q=80",
  },
  {
    title: "Expert Care",
    desc: "We provide world-class physiotherapy treatments with experienced professionals who ensure faster recovery and personalized care.",
    img: "https://images.unsplash.com/photo-1580281657521-6c5d3c1b9c92?auto=format&fit=crop&w=800&q=80",
  },
  {
    title: "Modern Clinics",
    desc: "State-of-the-art equipment and comfortable environments designed to deliver the best rehabilitation experience.",
    img: "https://images.unsplash.com/photo-1606813902919-9f0c3a67c8fa?auto=format&fit=crop&w=800&q=80",
  },
  {
    title: "Personalized Treatment",
    desc: "Customized therapy plans created for each patientâ€™s unique condition and recovery goals.",
    img: "https://images.unsplash.com/photo-1579154204601-01588f351e67?auto=format&fit=crop&w=800&q=80",
  },
];

export default function About() {
  return (
    <Box sx={{ bgcolor: "#f5f7fa", py: 8 }}>
      <Container>

        {/* Heading */}
        <motion.div
          initial={{ opacity: 0, y: -30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          <Typography variant="h3" textAlign="center" fontWeight="bold" gutterBottom>
            About PhysioTattva
          </Typography>
          <Typography variant="h6" textAlign="center" color="text.secondary" sx={{ mb: 6 }}>
            Healing through science, care and movement
          </Typography>
        </motion.div>

        {/* Ordered Sections */}
        {sections.map((item, index) => (
          <Grid
            container
            spacing={4}
            alignItems="center"
            sx={{ mb: 6 }}
            key={index}
            direction={index % 2 === 0 ? "row" : "row-reverse"} // zig-zag layout
          >
            {/* Image */}
            <Grid item xs={12} md={6}>
              <motion.img
  src={item.img}
  alt={item.title}
  style={{
    width: "100%",
    height: "400px",        // ðŸ‘ˆ fixed height
    objectFit: "cover",     // keeps image nicely cropped
    borderRadius: "16px",
  }}
  initial={{ opacity: 0, x: index % 2 === 0 ? -50 : 50 }}
  whileInView={{ opacity: 1, x: 0 }}
  transition={{ duration: 0.8 }}
/>

            </Grid>

            {/* Text */}
            <Grid item xs={12} md={6}>
              <motion.div
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.8 }}
              >
                <Typography variant="h4" fontWeight="bold" gutterBottom>
                  {item.title}
                </Typography>
                <Typography variant="body1" sx={{ fontSize: "1.1rem" }}>
                  {item.desc}
                </Typography>
              </motion.div>
            </Grid>
          </Grid>
        ))}

        {/* Mission & Vision */}
        <Grid container spacing={4} sx={{ mt: 4 }}>
          <Grid item xs={12} md={6}>
            <motion.div whileInView={{ opacity: 1, y: 0 }} initial={{ opacity: 0, y: 30 }}>
              <Typography variant="h5" fontWeight="bold" gutterBottom>
                Our Mission
              </Typography>
              <Typography>
                To deliver compassionate, innovative and result-driven physiotherapy services
                that help people regain strength, mobility and confidence.
              </Typography>
            </motion.div>
          </Grid>

          <Grid item xs={12} md={6}>
            <motion.div whileInView={{ opacity: 1, y: 0 }} initial={{ opacity: 0, y: 30 }}>
              <Typography variant="h5" fontWeight="bold" gutterBottom>
                Our Vision
              </Typography>
              <Typography>
                To be the most trusted physiotherapy and rehabilitation brand delivering
                world-class patient outcomes through research and technology.
              </Typography>
            </motion.div>
          </Grid>
        </Grid>

      </Container>
    </Box>
  );
}
